import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Image } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";
import Navbar from './nav';
class user extends Component {
  render() {
    // const {user}=this.props
    return (
      <div className="text-center "> 
         <Navbar/>
         <h1>User Details</h1>
        {console.log(this.props)}
        <h3 className="text-primary">User name={this.props.location.state.name}</h3>
       <h3 class="text-secondary">User location={this.props.location.state.location}</h3>
        <h3 class="text-secondary">Login as ={this.props.location.state.login}</h3>
        <h3 className="text-primary">User followers={this.props.location.state.fllowers}</h3>

  <Row className="text-center">
          <Col xs={6} md={4}>
            <Image src={this.props.location.state.img} className=" text-center profile-pic " roundedCircle />
            <h3 className="text-center">Frank</h3>
            <p>A young aspiring musician finds himself far out of his element after he joins an eccentric pop group led by the enigmatic Frank, who wears a giant fake head. As the band prepare to record their debut album, their personal issues generate tension.</p>
          </Col>
          </Row>

      </div>
    );
  }
}

export default user;
